  false,\n\t\"url\": null,\n\t\"notes\": \" This data set consists of an orthophotography
  tile index based onn                multi-spectral (red, green, blue, near-infrared)
  digital aerial imagery, collectedn                and processed by Wilson and Company,
  of the Las Conchas Fire that burned in then                Santa Fe National Forest
  in the Jemez Mountains of central New Mexico in the summern                of 2011.
  The Area of Interest (AOI) is 632,000 acres and is larger than the actualn                burn
  acreage of approximately 150,000 acres that lies within the AOI. Aerial imageryn
  \               was collected with a frame - based Z/I Digital Mapping Camera at
  an averagen                elevation of 4,500 feet above ground; generating an average
  ground sample distancen                (gsd) of 0.45 feet. The imagery will support
  the Forest Service Burned Arean                Emergency Response (BAER) program
  that addresses landscape damage due to the fire,n                with the goal of
  protecting life, property, water quality, and deterioratedn                ecosystems
  from further damage now that the fire is out. Mosaicked digitaln                orthorectified
  quarter-quarter quadrangles (DOQQQs) for the project area weren                produced.
  The DOQQQs cover the entire image area of one quarter of a USGS standardn                quarter
  quadrant, with a 260 meter buffer on all four sides. \",\n\t\"license_title\": null,\n\t\"extras\":
